import React from "react";
import { Card, Container, Row } from "react-bootstrap";
const Iterms = (props) => {
  return (
    <div>
      <Container>
        <Row>
          <Card>
            <Card.Img variant="top" src={props.details.imgUrl} />
            <Card.Body>
              <Card.Title> {props.details.name}</Card.Title>
              <Card.Text>
                <p>{props.details.price}</p>
              </Card.Text>
            </Card.Body>
          </Card>
        </Row>
      </Container>
    </div>
  );
};

export default Iterms;
